            year: "2018"
        },
        {
            degree: "Pre-Engineering",
            institute: "Excellence College",
            year: "2020"
        },
        {
            degree: "BSSE",
            institute: "NUML",
            year: "2025"
        }
    ];
    return (
        <div className="educationContainer">




        </div>
    );
}
